import React from "react";

export default function CityDetails(props) {
  if (!props.similarites) {
    return <div>Loading...</div>; 
  }

  return (
    <div className="container text-center mb-2">
      <div className="row">

        {/* Kraj */}
        <div
          className={`col-1 cityData ${
            props.similarites && props.similarites.sameRegion ? "correct" : "incorrect"
          }`}
          id="kraj"
        >
          <span className="align-center breakWord">
            {props.kraj_id}
          </span>
        </div>
        
        {/* Populace*/}
        <div
          className={
            "col-1 cityData " +
            (props.similarites.samePopulace === "="
              ? "correct"
              : props.similarites.samePopulace === "<"
              ? "incorrect-less"
              : props.similarites.samePopulace === ">"
              ? "incorrect-greater"
              : "")
          }
          id="populace"
        >
          <span className="align-center">{props.populace}</span>
        </div>

        {/* Rozloha */}
        <div
          className={
            "col-1 cityData " +
            (props.similarites.sameRozloha === "="
              ? "correct"
              : props.similarites.sameRozloha === "<"
              ? "incorrect-less"
              : props.similarites.sameRozloha === ">"
              ? "incorrect-greater"
              : "")
          }
          id="rozloha"
        >
          <span className="align-center">{props.rozloha}</span>
        </div>
      </div>
    </div>
  );
}
